const Card = ({ user }) => {
  const {
    avatar_url,
    followers,
    following,
    login,
    name,
    public_repos,
    url,
    created_at,
  } = user;

  const createdDate = new Date(created_at);

  return (
    <div>
      <div>
        <img src={avatar_url} alt="user" />
      </div>
      <div>
        <a href={`https://github.com/${login}`}>{name || login}</a>
      </div>
      <p>
        User joined on{" "}
        {`${createdDate.getDate()} ${createdDate.toLocaleString("en-us", {
          month: "short",
        })} ${createdDate.getFullYear()} `}
      </p>
    </div>
  );
};

export default Card;
